import { Button } from "@chakra-ui/button";
import { Image } from "@chakra-ui/image";
import { Flex, Text, Box} from "@chakra-ui/layout";
import { Link } from "react-router-dom";

import Ellipse from "../images/Ellipse.png";
import Raio from "../images/raio.png";
import wallet from "../images/wallet.png";

import '../CSS/TextOnMouseHover.css';

export default function NavGoNft() {


  return (
    <Flex
      p="24px"
      background="#FFFFFF"
      alignItems="center"
      justifyContent="space-between"
      w="100%"
      m="0 auto"
      maxW="1367px"
    >
      <Text 
      color="#FDC921" 
      ml="10px"
      fontSize="22px"
      fontWeight="900"
      >
      GoTokens
      </Text>
      <Box display="flex" mr="12px" className="TextAmarelo">
        <Text mr="28px">
        GoFund NFT
        </Text>
        <Text mr="29px">
        NFT
        </Text>
        <Text mr="22px">
        Educação
        </Text>
        <Image mr="27px" src={Ellipse}></Image>
        <Image mr="25px" src={Raio}></Image>
        <Image 
         onMouseOver={e => (e.currentTarget.src = Raio)}
         onMouseOut={e => (e.currentTarget.src = wallet)}
        ></Image>
      </Box>
    </Flex>
  );
}
